import React from 'react';

const ExercisesList = ({ exercises }) => {
    return (
        <div>
            {exercises.map}
            <h3>Logged Exercises</h3>
            <table className="table">
                <thead className="thead-light">
                    <tr>
                        <th>Username </th>
                        <th>Description</th>
                        <th>Duration</th>
                        <th>Date</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {/* {this.exerciseList()} */}
                </tbody>
            </table>
        </div>
    )

}
export default ExercisesList;
